  false,\n\t\"url\": null,\n\t\"notes\": \"This table is required for any Digital
  Flood Insurance Rate Map database where cross sections are shown on the Flood Insurance
  Rate Map (FIRM). Normally any FIRM that has associated flood profiles has cross
  sections. The S_XS table contains information about cross section lines. A spatial
  file with locational information also corresponds with this data table. These lines
  represent the locations of channel surveys performed for input into the hydraulic
  model used to calculate flood elevations. These locations are also shown on the
  Flood Profiles in the Flood Insurance Study (FIS) report and can be used to cross
  reference the Flood Profiles to the planimetric depiction of the flood hazards.
  All cross sections for which a spatial location is available should be included
  in this table. The spatial elements representing cross sections are lines generally
  extending from outside the floodplain, across the entire floodplain and out the
  other side. Each cross section should be represented by a single line feature without
  the hexagons shown on each end on the hardcopy map. The location and shape of the
  lines should depict as accurately as possible the position of the cross section
  used. This is a modified Standard DFIRM Database table that includes Standard DFIRM
  Database items and Enhanced Database items. All items after SOURCE_CIT are Enhanced.
  The Enhanced DFIRM Database must contain all modeled cross sections, whether they
  are printed on the FIRM or not. More information can be found in the document 'Guidelines
  and Specifications for Flood Hazard Mapping Partners Appendix LGuidance for Preparing
  Draft Digital Data and DFIRM Database' located on this disk.\",\n\t\"owner_org\":
